// src/pages/NovoTutor.jsx
import React, { useState, useEffect } from 'react';
import { useNavigate, Link } from 'react-router-dom';
import api from '../services/api';

export default function NovoTutor() {
  const navigate = useNavigate();
  const [form, setForm] = useState({
    nome: '',
    telefone: '',
    email: '',
    cpf: '',
    endereco: '',
    dataNascimento: '',
    dono: ''
  });
  const [donos, setDonos] = useState([]);
  const [errors, setErrors] = useState({});

  useEffect(() => {
    async function fetchDonos() {
      try {
        const res = await api.get('/donos');
        setDonos(res.data);
      } catch (err) {
        console.error('Erro ao carregar donos');
      }
    }
    fetchDonos();
  }, []);

  const handleChange = e => {
    const { name, value } = e.target;
    setForm(prev => ({ ...prev, [name]: value }));
    setErrors(prev => ({ ...prev, [name]: null }));
  };

  const handleSubmit = async e => {
    e.preventDefault();
    try {
      await api.post('/tutores', form);
      navigate('/tutores');
    } catch (err) {
      const resp = err.response?.data;
      if (resp?.erros) {
        const fieldErrors = resp.erros.reduce((acc, cur) => ({ ...acc, [cur.path]: cur.msg }), {});
        setErrors(fieldErrors);
      } else {
        setErrors({ form: resp?.erro || 'Erro ao cadastrar tutor' });
      }
    }
  };

  return (
    <div className="container my-5">
      <div className="d-flex justify-content-between align-items-center mb-4">
        <h2>Cadastrar Novo Tutor</h2>
        <div>
          <Link to="/" className="btn btn-outline-secondary me-2">Voltar ao Início</Link>
          <Link to="/tutores" className="btn btn-secondary">Ver Tutores</Link>
        </div>
      </div>

      {errors.form && <div className="alert alert-danger">{errors.form}</div>}

      <form onSubmit={handleSubmit}>
        <div className="mb-3">
          <label className="form-label">Nome</label>
          <input name="nome" className="form-control" value={form.nome} onChange={handleChange} />
          {errors.nome && <div className="text-danger">{errors.nome}</div>}
        </div>

        <div className="mb-3">
          <label className="form-label">Telefone</label>
          <input name="telefone" className="form-control" value={form.telefone} onChange={handleChange} />
          {errors.telefone && <div className="text-danger">{errors.telefone}</div>}
        </div>

        <div className="mb-3">
          <label className="form-label">Email</label>
          <input name="email" type="email" className="form-control" value={form.email} onChange={handleChange} />
          {errors.email && <div className="text-danger">{errors.email}</div>}
        </div>

        <div className="mb-3">
          <label className="form-label">CPF</label>
          <input name="cpf" className="form-control" value={form.cpf} onChange={handleChange} />
          {errors.cpf && <div className="text-danger">{errors.cpf}</div>}
        </div>

        <div className="mb-3">
          <label className="form-label">Endereço</label>
          <input name="endereco" className="form-control" value={form.endereco} onChange={handleChange} />
          {errors.endereco && <div className="text-danger">{errors.endereco}</div>}
        </div>

        <div className="mb-3">
          <label className="form-label">Data de Nascimento</label>
          <input type="date" name="dataNascimento" className="form-control" value={form.dataNascimento} onChange={handleChange} />
          {errors.dataNascimento && <div className="text-danger">{errors.dataNascimento}</div>}
        </div>

        <div className="mb-3">
          <label className="form-label">Dono</label>
          <select name="dono" className="form-select" value={form.dono} onChange={handleChange}>
            <option value="">Selecione um Dono</option>
            {donos.map(d => (
              <option key={d._id} value={d._id}>{d.nome}</option>
            ))}
          </select>
          {errors.dono && <div className="text-danger">{errors.dono}</div>}
        </div>

        <button type="submit" className="btn btn-primary">Cadastrar Tutor</button>
      </form>
    </div>
  );
}
